const Actions = {
    addTimer(value) {
      return {
        type: 'ADD_TIMER',
        value,
      }
    },
    addIntervalTimer(value) {
      return {
        type: 'ADD_INTERVAL_TIMER',
        value,
      }
    },
    updateIntervalTimer(value) {
      return {
        type: 'UPDATE_INTERVAL_TIMER',
        value,
      }
    },
    fetchtimer(value) {
      return {
        type: 'FETCHtimer',
        value,
      }
    },
  }

  export default Actions
